import React from 'react';

const QuickBooking = () => {
  return (
    <div className="bg-gray-800 p-4 flex justify-around items-center">
      <div>
        <select className="bg-gray-700 p-2 rounded-md text-white">
          <option>Chọn Rạp</option>
          {/* Add more options here */}
        </select>
      </div>
      <div>
        <select className="bg-gray-700 p-2 rounded-md text-white">
          <option>Chọn Phim</option>
          {/* Add more options here */}
        </select>
      </div>
      <div>
        <select className="bg-gray-700 p-2 rounded-md text-white">
          <option>Chọn Ngày</option>
          {/* Add more options here */}
        </select>
      </div>
      <div>
        <select className="bg-gray-700 p-2 rounded-md text-white">
          <option>Chọn Suất</option>
          {/* Add more options here */}
        </select>
      </div>
      <button className="bg-blue-600 px-4 py-2 rounded-md">Đặt Ngay</button>
    </div>
  );
};

export default QuickBooking;
